INSERT INTO `s_pages` (`id`, `url`, `name`, `meta_title`, `meta_description`, `meta_keywords`, `body`, `menu_id`, `position`, `visible`, `header`) VALUES
(2,'about-pierre-cardin','О Пьере Кардене','О Пьере Кардене','О Пьере Кардене','О Пьере Кардене','<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width: 100%;\"><tbody><tr><td align=\"top\"><h1>О дизайнере Пьере Кардене</h1><p>В истории моды есть несколько личностей, которые уже при жизни стали своеобразными мифами, символом того прекрасного и изменчивого искусства, которое называют Высокой модой.&nbsp;<strong>Одна такая легенда&nbsp;&mdash;&nbsp;&nbsp;Пьер Карден.</strong><strong><br /></strong>Его роскошный парижский офис расположен прямо напротив Дворца Президента Франции. В этом доме на авеню Марини, Пьер Карден работает почти полвека. Знаменитый мэтр при этом любит повторять: \"Чтобы стать кутюрье, им надо родиться\". Будущий великий модельер родился в 1922 году в небольшом городке неподалеку от Венеции, однако 1925 году его семья переезжает во Францию.</p><p>&nbsp;&nbsp;В 1945 году Пьер Карден впервые&nbsp;приезжает в Париж.&nbsp; Вскоре он увлекается &nbsp;архитектурой, но потом, решает сделать карьеру все же в мире моды (а для этого надо было стать прекрасным мастером), он устроился работать в самые престижные парижские дома моды - ассистентом у мадам Пакин (Madame Paquin), Эльзы Скиапарелли (Elsa Schiaparelli) и Кристиана Диора (Christian Dior).</p></td><td><img width=\"240\" height=\"306\" alt=\"Pierre Cardin\" src=\"/files/uploads/pierre_cardin.jpg\" /></td></tr></tbody></table><p>&nbsp;В 1946 он стал ведущим дизайнером в студии Кристиана Диора. Там он получил бесценный опыт и помогал в создании великолепных платьев для \"Красавицы и чудовища\" Жана Кокто. \"Я делал костюмы к фильмам Кокто, сам, вот этими руками, я обшивал Жана Маре... Все примерки делались на меня\",&nbsp;&mdash;&nbsp;рассказывал позднее он.&nbsp;<br />В 1960-м он совершает настоящую революцию, он первым вводит в обращение систему лицензирования и открывает производство своей одежды в Японии, Китае и в Советском Союзе. 900 лицензий, распространенных в 140 странах мира и 200000 человек по всему миру, работающих в настоящее время под торговой маркой \"Pierre Cardin\", делают ее одной из самых успешных в мире.</p><div>По признанию самого мэтра, он часто бывает в России и любит нашу страну. В 1986 году Карден подписал первый контракт на производство своей коллекции на территории России. А в июне 1991 года состоялся грандиозный показ 50 моделей Пьера Кардена на Красной Площади в Москве перед 200-тысячной аудиторией.</div><div>Пьер Карден (Pierre Cardin) запатентовал более 500 дизайнерских изобретений, которые охватывают достижения не только в области моделирования одежды, но и транспорта, архитектуры и рекламы. На данный момент под его именем открыты более 8 тысяч бутиков, рестораны, театры, часы, парфюмерия, облицовочная плитка, производство элитной&nbsp; мебели, аксессуары и многое другое.</div><h3>Торговая марка Pierre Cardin известна во всем мире.</h3><div>Это истинно французский шик и элегантность.</div><div>&nbsp;Карден является обладателем 24 престижных международных и французских наград. В 1974 году Карден стал кавалером ордена</div><div>&nbsp;</div><div>Почетного легиона, а в 1988&nbsp;&mdash;&nbsp;итальянского ордена \"За заслуги\" и \"Священные сокровища\" - высшей награды Ватикана. В 1985 году Карден был избран членом французской Академии изящных искусств и стал \"бессмертным\", как называют во Франции почетных академиков. В 1990 году коллекции Кардена выставлялись в лондонском Музее Виктории и Альберта, что является большой честью даже для знаменитых мастеров.&nbsp;</div><p>Сам Пьер Карден считает свою жизнь удавшейся:&nbsp;<strong>&laquo; Не так много людей, которые могут сказать, что они счастливы в жизни, но я могу сказать, что я счастлив.&raquo;</strong></p>',1,3,1,'О Пьере Кардене'),
